  "title": {
    "nb": "Potensielt tilgjengelig strandsone"
  },
  "description": {
    "nb": "Potensielt tilgjengelige strandsonearealer i strandsonen beregnes ut fra terreng, veistrekninger, jernbanestrekninger, dyrket markarealer, bygninger og kystlinje. Dataene er hentet fra ulike kilder og bearbeidet til arealbruksflater i SSB. De flater som ikke er påvirket av tekniske inngrepp betraktes som potensielt tilgjengelige for friluftslivsaktiviteter. De ulike flatene innholder også egenskaper som viser til helling: liten helling \u0026lt;3, noe helling 3-10, stor helling 10-25 og veldig stor helling \u0026gt;25 grader.\n\nPotensielt tilgjengelige strandsonearealer er geografiske områder som har en dynamisk avgrensing, og antall flateobjekt og deres yttergrenser vil endre seg over tid avhengig av byggeaktivitet.\n\nFlateobjektene avgrenses uavhengig av de administrative grensene."
  },
