  "title": {
    "nb": "Støykartlegging veg etter T-1442"
  },
  "description": {
    "nb": "Denne tjenesten inneholder Støyvarselkart etter T-1442. Støyvarselkartene er utarbeidet etter Retningslinje for behandling av støy i arealplanlegging (T-1442). Støyvarselkartene viser beregnet rød (Lden\u0026gt;65dB) og gul (Lden\u0026gt;55dB) støysone langs riks- og fylkesveg. Støyvarselkartene fra Statens vegvesen viser en prognosesituasjon 15–20 år fram i tid. Det vil si at trafikkvolum (ÅDT), som er en av de viktigste parameterne i støyberegningsmodellen, er fremskrevet (basert på prognoser) til oppgitt beregningsår. Beregningshøyden er 4 meter. Kartleggingene er gjennomført med Statens vegvesens beregningsverktøy NorStøy. Beregningsmetode er Nord2000Road. Data om vegene og trafikken hentes fra Nasjonal vegdatabank (NVDB). De viktigste parameterne er ÅDT, tungtrafikkandel og hastighet. Kartdata hentes fra felles kartdatabasen (FKB). Informasjon om bygninger hentes fra matrikkelen."
  },
