  "title": {
    "nb": "Radon aktsomhet"
  },
  "description": {
    "nb": "Datasettet viser hvilke områder i Norge som trolig er mer radonutsatt enn andre. Datasettet er basert på geologi og inneluftsmålinger av radon. Inneluftsmålinger er fra NRPA sin nasjonale database, og geologi er fra NGU sine berggrunns- og løsmassedatabaser. Berggrunnsdata er av målestokk 1:250.000 og løsmassedata er av varierende målestokk, fra 1:50.000 til 1:1000.000 Inneluftsmålinger er brukt til å identifisere områder med forhøyd aktsomhet for radon. De er også brukt til å kjennetegne geologi i forhold til aktsomhet for radon, og denne kunnskapen er overført til områder hvor det finnes ingen eller få inneluftsmålinger. Der hvor et område er klassifisert som «høy aktsomhet» er det beregnet at minst 20% av boligene har radonkonsentrasjoner over 200 Bq/m3, med 70% statistisk sikkerhet. Der hvor et område er klassifisert som «middels til lav aktsomhet» er det beregnet at opp til 20% av boligene har radonkonsentrasjoner over 200 Bq/m3, med 70% statistisk sikkerhet. Der hvor det ikke er nok data, eller hvor det ikke er nok statistisk sikkerhet for å beregne aktsomhet for radon, er områder klassifisert som «usikker aktsomhet». Alunskifer er tilknyttet forhøyde radonkonsentrasjoner. Områder hvor det finnes alunskifer er klassifisert som «særlig høy aktsomhet». Med å overføre kunnskap fra områder med inneluftsmålinger til områder uten inneluftsmålinger, er det antatt at radonegenskaper av en geologitype er det samme i hele landet. I praksis kan det forventes noe variasjon i radonegenskaper i polygoner av den samme geologitypen. I tillegg kan det forventes variasjon i radonegenskaper innenfor et polygon."
  },
