  "description": {
    "nb": "N250 Raster er en gjengivelse av temaene i N250 Kartdata og har en presentasjon som så langt mulig er lik N50 Raster. N250 Raster dekker fastlands-Norge og er begrenset av riksgrensen mot nabolandene og territorialgrensen i havet. N250 Raster baserer seg på N250 Kartdata og distribueres ukentlig. N250 Raster på GeoTIFF-format leveres tile-vis i områder 1 grad Ø-V og 0,5 grader N-S. \nFølgende referansefiler medfølger GeoTIFF-formatet: SOSI og TFW."
  },
