  "title": {
    "nb": "Forsvarets skyte- og øvingsfelt land"
  },
  "description": {
    "nb": "Datasettet inneholder den flatemessige utbredelsen av militære skyte- og øvingsfelt avgrenset av Forsvarets eide/leide grunn, og Forsvarets ervervede rettigheter til bruk av arealet til skyte- og øvingsaktivitet, herunder også klausulerte fareområder (sikkerhetssoner). Datasettet beskriver IKKE fare-/restriksjonsområder for luftfarten som kan avvike fra skytefeltets geografiske representasjon på bakken. Datasettet inneholder kun skytefelt som er forvaltet av Forsvarsbygg. Skytefelt i sjø forvaltes primært av Sjøforsvaret, og er ikke med i dette datasettet. Deler av dette datasettet leveres også til Kartverkets N50-serie."
  },
