  "title": {
    "nb": "Arealressurskart - AR250 - Treslag"
  },
  "description": {
    "nb": "Kartlag i det landsdekkende datasettet AR250 som viser hovedklasser av skogtyper på skogarealet i målestokk 1:250 000. Kartlaget er tilpasset bruk i målestokker fra 1:100 000 til 1: 300 000. Egenskap som skal brukes til å fremstille kartlaget heter ARTESLAG. Figurer som er mindre enn 100 dekar, vises ikke på kartet, men blir slått sammen med tilgrensende områder. \n\nDatasettet oppdateres en gang hvert tredje år med siste års versjon av FKB-AR5 (Arealressurskart i målestokk 1:5000 i databasen pr. 31.12). Siste oppdatering har data fra 31.12.2016. Data lastes ned som fylkesvise eller kommunevise filer."
  },
