  "title": {
    "nb": "Reindrift - Årstidsbeite - Høstbeite"
  },
  "description": {
    "nb": "Den sesongmessige arealbruken er delt inn i fem årstider, som igjen er delt inn i to kategorier etter funksjon og beiteintensitet. Høstbeite er områder som reinen bruker på høsten. Det finnes to kategorier høstbeite. Høstbeite 1: Parringsland - de deler av høstområdet der oksereinen samler simleflokkene til parring under brunsten Høstbeite 2: Tidlig høstland - partier der reinen bygger seg opp etter insektplagen og spres på leting etter sopp. Beitebruken vil variere fra år til år innen samme område. Inndelingssystemet gjelder reindrifta i hele landet. De årlige variasjonene i bl.a. vær og beiteforhold gjør at årstidsavgrensningene må bli noe vide og omtrentlige."
  },
