  "title": {
    "nb": "Konnekteringspunkter mellom Norge og Sverige"
  },
  "description": {
    "nb": "Det er etablert konnekteringspunkter for temaene kraftlinjer, veger, stier, bygninger, jernbane, elver og innsjøkontur som krysser riksgrensen mellom Norge og Sverige.\nDataene for de respektive landene kan da settes sammen slik at man får et godt kartbilde.\nDet er de nasjonale kartverkene i Sverige og Norge som vedlikeholder datasettet. Kilde for endringer er fotogrammetrisk konstruksjon og digitalisering fra ortofoto."
  },
